dows Remote Access improperly handles file     operations. An attacker who successfully exploited this     vulnerability could gain elevated privileges.\n    (CVE-2020-1537)\n\n  - An elevation of privilege vulnerability exists when an     attacker establishes a vulnerable Netlogon secure     channel connection to a domain controller, using the     Netlogon Remote Protocol (MS-NRPC). An attacker who     successfully exploited the vulnerability could run a     specially crafted application on a device on the     network.  (CVE-2020-1472)\n\n  - An elevation of privilege vulnerability exists when the     Windows Kernel API improperly handles registry objects     in memory. An attacker who successfully exploited the     vulnerability could gain elevated privileges on a     targeted system. A locally authenticated attacker could     exploit this vulnerability by running a specially     crafted application. The security update addresses the     vulnerability by helping to ensure that the Windows     Kernel API properly handles objects in memory.\n    (CVE-2020-1377, CVE-2020-1378)\n\n  - An elevation of privilege vulnerability exists when the     Windows Print Spooler service improperly allows     arbitrary writing to the file system. An attacker who     successfully exploited this vulnerability could run     arbitrary code with elevated system privileges. An     attacker could then install programs; view, change, or     delete data; or create new accounts with full user     rights.  (CVE-2020-1337)\n\n  - An information disclosure vulnerability exists when the     Windows Image Acquisition (WIA) Service improperly     discloses contents of its memory. An attacker who     successfully exploited the vulnerability could obtain     information to further compromise the users system.\n    (CVE-2020-1474, CVE-2020-1485)\n\n  - An elevation of privilege vulnerability exists when the     Windows Ancillary Function Driver for WinSock improperly     handles memory.  (CVE-2020-1587)\n\n  - A remote code execution vulnerability exists when the     Windows Jet Database Engine improperly handles objects     in memory. An attacker who successfully exploited this     vulnerability could execute arbitrary code on a victim     system. An attacker could exploit this vulnerability by     enticing a victim to open a specially crafted file. The     update addresses the vulnerability by correcting the way     the Windows Jet Database Engine handles objects in     memory. (CVE-2020-1473, CVE-2020-1557, CVE-2020-1558,     CVE-2020-1564)\n\n  - A remote code execution vulnerability exists when     Microsoft .NET Framework processes input. An attacker     who successfully exploited this vulnerability could take     control of an affected system.  (CVE-2020-1046)\n\n  - A remote code execution vulnerability exists in the way     that the MSHTML engine improperly validates input. An     attacker could execute arbitrary code in the context of     the current user.  (CVE-2020-1567)\n\n  - An elevation of privilege vulnerability exists in the     way that the Windows Graphics Device Interface (GDI)     handles objects in memory. An attacker who successfully     exploited this vulnerability could run arbitrary code in     kernel mode. An attacker could then install programs;\n    view, change, or delete data; or create new accounts     with full user rights.  (CVE-2020-1529)\n\n  - A remote code execution vulnerability exists in the way     that the scripting engine handles objects in memory in     Internet Explorer. The vulnerability could corrupt     memory in such a way that an attacker could execute     arbitrary code in the context of the current user. An     attacker who successfully exploited the vulnerability     could gain the same user rights as the current user.\n    (CVE-2020-1380, CVE-2020-1570)\n\n  - An elevation of privilege vulnerability exists when the     Windows AppX Deployment Extensions improperly performs     privilege management, resulting in access to system     files.  (CVE-2020-1488)\n\n  - An elevation of privilege vulnerability exists when the     Windows Function Discovery SSDP Provider improperly     handles memory.  (CVE-2020-1579)\n\n  - An elevation of privilege vulnerability exists when     ASP.NET or .NET web applications running on IIS     improperly allow access to cached files. An attacker who     successfully exploited this vulnerability could gain     access to restricted files.  (CVE-2020-1476)\n\n  - An elevation of privilege vulnerability exists when     Windows Remote Access improperly handles memory.\n    (CVE-2020-1530)\n\n  - A remote code execution vulnerability exists in the way     that Microsoft Graphics Components handle objects in     memory. An attacker who successfully exploited the     vulnerability could execute arbitrary code on a target     system.  (CVE-2020-1562)\n\n  - A spoofing vulnerability exists when Windows incorrectly     validates file signatures. An attacker who successfully     exploited this vulnerability could bypass security     features and load improperly signed files. In an attack     scenario, an attacker could bypass security features     intended to prevent improperly signed files from being     loaded. The update addresses the vulnerability by     correcting how Windows validates file signatures.\n    (CVE-2020-1464)',_binary '\r)\ï¿½ï¿½.ï¿½l6\r\ï¿½Cï¿½\ï¿½00ï¿½_\ï¿½\"\ï¿½\ï¿½x\ï¿½]\ï¿½ï¿½\'6Sxwï¿½\ï¿½8iï¿½^z\ï¿½cU>ï¿½ZÊ»ï¿½ï¿½z\ï¿½|ï¿½mï¿½ï¿½!'),(11,'The remote Windows host is missing security update 5010395. It is, therefore, affected by multiple vulnerabilities   \n  - An information disclosure vulnerability. An attacker can     exploit this to disclose potentially sensitive     information. (CVE-2022-21998)\n\n  - A denial of service (DoS) vulnerability. An attacker can     exploit this issue to cause the affected component to     deny system or application services. (CVE-2022-22002)\n\n  - A remote code execution vulnerability. An attacker can     exploit this to bypass authentication and execute     unauthorized arbitrary commands. (CVE-2022-21993)\n\n  - An elevation of privilege vulnerability. An attacker can     exploit this to gain elevated privileges.\n    (CVE-2022-21989, CVE-2022-21997, CVE-2022-21999,     CVE-2022-22000, CVE-2022-22001)\n\nNote that Nessus has not tested for this issue but has instead relied only on the application\'s self-reported version number.',_binary '#c-ï¿½4=\ni_\ï¿½Gï¿½ï¿½\ï¿½\ï¿½ï¿½vï¿½ï¿½ ï¿½ï¿½ï¿½*ï¿½ï¿½ï¿½q\ï¿½\ï¿½L8ï¿½lï¿½ï¿½hï¿½<\r.y\ï¿½Y\ï¿½\ï¿½!4cxa\ï¿½\ï¿½\ï¿½a'),(12,'The remote service uses an SSL certificate chain that has been signed using a cryptographically weak hashing algorithm (e.g. MD2, MD4, MD5, or SHA1). These signature algorithms are known to be vulnerable to collision attacks. An attacker can exploit this to generate another certificate with the same digital signature, allowing an attacker to masquerade as the affected service.\n\nNote that this plugin reports all SSL certificate chains signed with SHA-1 that expire after January 1, 2017 as vulnerable. This is in accordance with Google\'s gradual sunsetting of the SHA-1 cryptographic hash algorithm.\n\nNote that certificates in the chain that are contained in the Nessus CA database (known_CA.inc) have been ignored.',_binary '1\ï¿½PÐ¦ï¿½\ZAE~ï¿½ï¿½\ï¿½H\"ï¿½ï¿½e\ï¿½,$\nÝš]70dï¿½@\ï¿½oï¿½\ï¿½\ï¿½e\ï¿½uï¿½(ï¿½ï¿½)>pï¿½ï¿½ï¿½ï¿½ï¿½ï¿½\ï¿½5\ï¿½3ï¿½c'),(13,'The remote Windows host is affected by an elevation of privilege vulnerability in the Security Account Manager (SAM) and Local Security Authority (Domain Policy) (LSAD) protocols due to improper authentication level negotiation over Remote Procedure Call (RPC) channels. A man-in-the-middle attacker able to intercept communications between a client and a server hosting a SAM database can exploit this to force the authentication level to downgrade, allowing the attacker to impersonate an authenticated user and access the SAM database.',_binary 'ï¿½Uk\ï¿½gmï¿½ï¿½ntï¿½ï¿½ï¿½ï¿½>.	ï¿½\ï¿½\ï¿½ï¿½\ï¿½oê°‚\ï¿½ï¿½J\ï¿½8]\ï¿½\ï¿½G#\ï¿½<ï¿½K\ï¿½PS\ï¿½\ï¿½H0Yï¿½Ñµ;'),(14,'The remote Windows host is missing security update 5010412. It is, therefore, affected by multiple vulnerabilities\n\n  - An information disclosure vulnerability. An attacker can     exploit this to disclose potentially sensitive     information. (CVE-2022-21993, CVE-2022-21998)\n\n  - A denial of service (DoS) vulnerability. An attacker can     exploit this issue to cause the affected component to     deny system or application services. (CVE-2022-22002)\n\n  - A remote code execution vulnerability. An attacker can     exploit this to bypass authentication and execute     unauthorized arbitrary commands. (CVE-2022-21993)\n\n  - An elevation of privilege vulnerability. An attacker can     exploit this to gain elevated privileges.\n    (CVE-2022-21989, CVE-2022-21997, CVE-2022-21999,     CVE-2022-22000, CVE-2022-22001)\n\nNote that Nessus has not tested for this issue but has instead relied only on the application\'s self-reported version number.',_binary 'ï¿½5ï¿½ï¿½qï¿½2\ï¿½\ï¿½8Mï¿½ï¿½\ï¿½%\ï¿½D!ï¿½nï¿½\ï¿½Wt@Hx`ï¿½\ï¿½_Yï¿½nï¿½h,ï¿½`\ï¿½rM-ï¿½\ï¿½ï¿½_\ï¿½ï¿½&y,Vï¿½.\ï¿½\ï¿½_\ï¿½'),(15,'The remote Windows host is missing a security update. It is, therefore, affected by the following vulnerabilities :\n\n  - Multiple remote code execution vulnerabilities exist in     Microsoft Server Message Block 1.0 (SMBv1) due to     improper handling of certain requests. An     unauthenticated, remote attacker can exploit these     vulnerabilities, via a specially crafted packet, to     execute arbitrary code. (CVE-2017-0143, CVE-2017-0144,     CVE-2017-0145, CVE-2017-0146, CVE-2017-0148)\n\n  - An information disclosure vulnerability exists in     Microsoft Server Message Block 1.0 (SMBv1) due to     improper handling of certain requests. An     unauthenticated, remote attacker can exploit this, via a     specially crafted packet, to disclose sensitive     information. (CVE-2017-0147)\n\nETERNALBLUE, ETERNALCHAMPION, ETERNALROMANCE, and ETERNALSYNERGY are four of multiple Equation Group vulnerabilities and exploits disclosed on 2017/04/14 by a group known as the Shadow Brokers. WannaCry / WannaCrypt is a ransomware program utilizing the ETERNALBLUE exploit, and EternalRocks is a worm that utilizes seven Equation Group vulnerabilities. Petya is a ransomware program that first utilizes CVE-2017-0199, a vulnerability in Microsoft Office, and then spreads via ETERNALBLUE.',_binary '\ï¿½\ï¿½\ï¿½S e\ï¿½ï¿½x3ï¿½fo\ï¿½!v\\ï¿½y.ï¿½ï¿½ï¿½È·rOCÈ»ï¿½\ï¿½Lzï¿½bSï¿½1Ù˜ xï¿½ï¿½ï¿½\ï¿½\\\ï¿½\ï¿½pï¿½ï¿½ï¿½c\ï¿½ï¿½ï¿½'),(16,'The remote Windows host is missing security update 4015548 or cumulative update 4015551. It is, therefore, affected by multiple vulnerabilities :\n\n  - An information disclosure vulnerability exists in the     open-source libjpeg image processing library due to     improper handling of objects in memory. An     unauthenticated, remote attacker can exploit this to     disclose sensitive information that can be utilized to     bypass ASLR security protections. (CVE-2013-6629)\n\n  - An information disclosure vulnerability exists in     Windows DirectShow due to improper handling of objects     in memory. Any unauthenticated, remote attacker can     exploit this, by convincing a user to visit a website     with specially crafted media content, to disclose     sensitive information. (CVE-2017-0042)\n\n  - Multiple information disclosure vulnerabilities exist in     the win32k component due to improper handling of kernel     information. A local attacker can exploit these     vulnerabilities, via a specially crafted application, to     disclose sensitive information. (CVE-2017-0058,     CVE-2017-0188)\n\n  - Multiple flaws exist in Windows Hyper-V Network Switch     due to improper validation of input from the guest     operating system. A local attacker can exploit these,     via a specially crafted application on the guest, to     execute arbitrary code on the host system.\n    (CVE-2017-0163, CVE-2017-0180)\n\n  - A flaw exists in LDAP due to buffer request lengths not     being properly calculated. An unauthenticated, remote     attacker can exploit this, via specially crafted traffic     sent to a Domain Controller, to run processes with     elevated privileges. (CVE-2017-0166)\n\n  - Multiple information disclosure vulnerabilities exist in     Windows Hyper-V Network Switch due to improper validation     of user-supplied input. A guest attacker can exploit     these to disclose sensitive information on the host     server. (CVE-2017-0168, CVE-2017-0169)\n\n  - Multiple denial of service vulnerabilities exist in     Windows Hyper-V Network Switch due to improper     validation of input from the guest operating system. A     local attacker on the guest can exploit these     vulnerabilities, via a specially crafted application, to     crash the host system. (CVE-2017-0182, CVE-2017-0183,     CVE-2017-0185, CVE-2017-0186)\n\n  - Multiple denial of service vulnerabilities exist in     Hyper-V due to improper validation of input from a     privileged user on a guest operating system. A local     attacker on the guest can exploit these, via a specially     crafted application, to cause the host system to crash.\n    (CVE-2017-0184)\n\n  - A flaw exists in Windows due to improper handling of     objects in memory that allows an attacker to cause a     denial of service condition. (CVE-2017-0191)\n\n  - An information disclosure vulnerability exists in the     Adobe Type Manager Font Driver (ATMFD.dll) due to     improper handling of objects in memory. An     unauthenticated, remote attacker can exploit this, by     convincing a user to open a specially crafted document     or visit a malicious web page, to disclose sensitive     information. (CVE-2017-0192)\n\n  - An arbitrary code execution vulnerability exists in     Microsoft Office and Windows WordPad due to improper     handling of specially crafted files. An unauthenticated,     remote attacker can exploit this, by convincing a user     to open a malicious file, to execute arbitrary code in     the context of the current user. Note that this     vulnerability is being utilized to spread the Petya     ransomware. (CVE-2017-0199)\n\n  - A memory corruption issue exists in Internet     Explorer in the JScript and VBScript engines due to     improper validation of user-supplied input. An     unauthenticated, remote attacker can exploit this, by     convincing a user to visit a malicious website, to     execute arbitrary code. (CVE-2017-0201)\n\n  - A privilege escalation vulnerability exists in Internet     Explorer due to a failure to properly enforce     cross-domain policies. An unauthenticated, remote     attacker can exploit this to inject arbitrary content     and gain elevated privileges. (CVE-2017-0210)\n\n  - A privilege escalation vulnerability exists in Microsoft     Windows OLE due to an unspecified failure in     integrity-level checks. An authenticated, remote     attacker can exploit this to run an application with     limited privileges at a medium integrity level. Note     that this vulnerability by itself does not allow     arbitrary code execution but can be used in conjunction     other vulnerabilities. (CVE-2017-0211)',_binary '2ï¿½ï¿½\ï¿½cï¿½2=\ï¿½mï¿½ Ö¦~[RÌ‘4aï¿½7\ï¿½ï¿½J-{ï¿½+ï¿½WÒ¡ï¿½)ï¿½\ï¿½nDkï¿½5[>\ï¿½ÏœOk\rï¿½\ï¿½Bï¿½D6\"'),(17,'The remote host supports the use of SSL ciphers that offer medium strength encryption. Nessus regards medium strength as any encryption that uses key lengths at least 64 bits and less than 112 bits, or else that uses the 3DES encryption suite.\n\nNote that it is considerably easier to circumvent medium strength encryption if the attacker is on the same physical network.',_binary 'ï¿½\ï¿½ï¿½6/\ï¿½|Q\ï¿½o:ï¿½\ï¿½n2\ï¿½e7iï¿½(ï¿½\ï¿½\ï¿½Gï¿½j\ï¿½\ï¿½w\ï¿½\ï¿½Uï¿½Ñ³I\ï¿½BNï¿½ï¿½ï¿½bqï¿½\ï¿½ï¿½ï¿½ï¿½ï¿½ï¿½E\ï¿½9k!ï¿½v'),(18,'The remote version of the Remote Desktop Protocol Server (Terminal Service) is vulnerable to a man-in-the-middle (MiTM) attack. The RDP client makes no effort to validate the identity of the server when setting up encryption. An attacker with the ability to intercept traffic from the RDP server can establish encryption with the client and server without being detected. A MiTM attack of this nature would allow the attacker to obtain any sensitive information transmitted, including authentication credentials.\n\nThis flaw exists because the RDP server stores a hard-coded RSA private key in the mstlsapi.dll library. Any local user with access to this file (on any Windows system) can retrieve the key and use it for this attack.',_binary '$ï¿½aï¿½ï¿½ï¿½Þ›ï¿½\'dRlï¿½yÌŽ\ï¿½\ï¿½Øˆï¿½\ï¿½ï¿½\ï¿½\ï¿½Rï¿½#\ï¿½mï¿½Icï¿½{ï¿½Mï¿½ï¿½{ï¿½Bb9!A(\ï¿½)\ï¿½1]ï¿½ï¿½ï¿½\"ï¿½ï¿½'),(19,'The Windows kernel on the remote host has the following vulnerabilities :\n\n  - A memory allocation vulnerability exists.\n    (CVE-2013-1300)\n\n  - A dereference vulnerability exists. (CVE-2013-1340)\n\n  - A privilege escalation vulnerability exists in the     Windows kernel-mode driver. (CVE-2013-1345)\n\n  - A TrueType Font parsing vulnerability exists.\n    (CVE-2013-3129)\n\n  - An information disclosure vulnerability exists.\n    (CVE-2013-3167)\n\n  - A buffer overflow vulnerability exists. (CVE-2013-3173)\n\n  - A flaw exists in kernel-mode drivers in how linked lists     pointers are handled in PATHREC objects. (CVE-2013-3660)\n\nA remote attacker could exploit any of these vulnerabilities to elevate privileges.',_binary 'ï¿½C@s\ï¿½\ï¿½\ï¿½#ï¿½z/ï¿½8B\ï¿½*ï¿½Ä±_b|!n\ï¿½\ï¿½Aï¿½ï¿½ï¿½YÐƒï¿½Zï¿½M\ï¿½\ï¿½\ï¿½4R\ï¿½\ï¿½\ï¿½V\ï¿½\\I \ï¿½\ï¿½\ï¿½\ï¿½ï¿½ï¿½C'),(20,'The remote Windows host is affected by multiple vulnerabilities :\n\n  - A privilege escalation vulnerability allows an attacker     to run arbitrary code in kernel mode due to the     kernel-mode driver improperly handling objects in     memory. (CVE-2014-4113)\n\n  - A remote code execution vulnerability allows a remote     attacker to run arbitrary code in kernel mode due to the     kernel-mode driver improperly handling TrueType fonts.\n    An attacker can exploit this vulnerability by convincing     a user to open a file or visit a website containing a     specially crafted TrueType font file. (CVE-2014-4148)',_binary 'M\ï¿½(z\ï¿½ï¿½mï¿½ï¿½\ï¿½Sï¿½E\ï¿½r.Y}ï¿½Ð¼@Ïžï¿½ï¿½\ï¿½\ï¿½qï¿½9I1ï¿½ï¿½:Jï¿½!\ï¿½ï¿½Ö¨\ï¿½USï¿½ï¿½0\ï¿½;ï¿½ï¿½V\rTf:)\ï¿½');
